function test_gtfb_analyzer

    % basic mha config for 2 channel stft
    desc.instance = 'test_gtfb_analyzer';
    desc.nchannels_in = 1;
    desc.fragsize = 50;
    desc.srate = 16276;
    desc.mhalib = 'gtfb_analyzer';
    desc.iolib = 'MHAIOParser';

    % gtfb_analyzer configuration
    desc.mha.order=4;
    desc.mha.coeff=[...
                     0.98687+0.027909i 0.98497+0.040962i 0.98265+0.05545i 0.97983+0.07152i 0.97637+0.089328i...
                     0.97215+0.10905i 0.96698+0.13085i 0.96066+0.15493i 0.95293+0.18148i 0.94346+0.21069i...
                     0.93188+0.24274i 0.91772+0.2778i 0.90043+0.31599i 0.87933+0.35739i 0.85364+0.40199i...
                     0.82243+0.44966i 0.78463+0.50008i 0.739+0.55271i 0.68418+0.60668i 0.61871+0.66066i...
                     0.54109+0.71281i 0.44993+0.76055i 0.3441+0.80047i 0.22313+0.82819i 0.087552+0.83829i...
                     -0.06043+0.82438i -0.21622+0.7794i -0.37195+0.69641i -0.51569+0.56983i -0.63098+0.39762i...
                   ];
    desc.mha.norm_phase=[...
                          5.2669e-08 8.087e-08 1.2413e-07 1.9046e-07 2.9212e-07...
                          4.4782e-07 6.8618e-07 1.0508e-06 1.6082e-06 2.4594e-06...
                          3.7584e-06 5.7384e-06 8.7531e-06 1.3337e-05 2.0298e-05...
                          3.085e-05 4.6819e-05 7.0937e-05 0.00010728 0.00016192...
                          0.00024385 0.0003663 0.00054874 0.00081951 0.0012198...
                          0.0018087 0.0026708 0.0039257 0.005741 0.008349...
                        ];
    % create a new MHA process
    mha = mha_start();

    % ensure MHA is exited after the test
    unittest_teardown(@mha_set, mha, 'cmd', 'quit');

    % configure the new MHA
    mha_set(mha,'',desc);
    mha_set(mha, 'cmd', 'start');

    % create test signal
    s_in=[1 zeros(1,49)];

    % process the signal
    mha_set(mha,'io.input',s_in);
    s_out = mha_get(mha,'io.output');

    % combine pairs of real channels to complex channels
    actual=complex(s_out(1:2:end,:),s_out(2:2:end,:));
    
    % Compare reference output and output signal.
    expected = get_expected_output();
    assert_difference_below(expected, actual, 10^(-80/20));

end

